import{f as a,g as s,J as e}from"./common-03e46d7f.js";const n='{"title":"前端调试通过秘籍学习笔记","frontmatter":{"date":"2022-10-09","title":"前端调试通过秘籍学习笔记","tags":["tool"],"describe":"掘金小册《前端调试通关秘籍》的学习笔记"},"headers":[{"level":2,"title":"为什么学习这门课程","slug":"为什么学习这门课程"},{"level":2,"title":"调试概念","slug":"调试概念"},{"level":3,"title":"Chrome DevTools原理","slug":"chrome-devtools原理"},{"level":2,"title":"调试js代码","slug":"调试js代码"},{"level":3,"title":"VSCode Debugger配置详解","slug":"vscode-debugger配置详解"},{"level":2,"title":"sourcemap的原理和作用","slug":"sourcemap的原理和作用"},{"level":3,"title":"sourcemap的生成","slug":"sourcemap的生成"},{"level":2,"title":"webpack的sourcemap配置","slug":"webpack的sourcemap配置"},{"level":3,"title":"eval","slug":"eval"},{"level":3,"title":"source-map","slug":"source-map"},{"level":3,"title":"cheap","slug":"cheap"},{"level":3,"title":"module","slug":"module"},{"level":3,"title":"nosources","slug":"nosources"},{"level":2,"title":"调试React代码","slug":"调试react代码"}],"relativePath":"docs/tool/debugging.md","lastUpdated":1743566425696.404}';var p={};const o=[e('<h2 id="为什么学习这门课程"><a class="header-anchor" href="#为什么学习这门课程" aria-hidden="true">#</a> 为什么学习这门课程</h2><p>我在平时工作中经常会遇到这几种问题：</p><ol><li>后端返回的接口格式不太准确，于是通过<code>console.log</code>打印接口返回的数据</li><li>写了一段代码，不知道运行结果对不对，通过代码中添加<code>debugger</code>或打断点进行调试</li><li>写一段node脚本，不知道运行结果，通过<code>console.log</code>打印输出</li><li>想学习源码，通过打断点的方式进行调试</li><li>...</li></ol><p>相信很多开发都会有这样的问题，那么想要做好这些就需要系统的学习下前端调试，所以我很推荐大家学习<a href="https://juejin.cn/book/7070324244772716556/section/7136841909959393293" target="_blank" rel="noopener noreferrer">这门课程</a>，恶补很多不知道的知识。</p><h2 id="调试概念"><a class="header-anchor" href="#调试概念" aria-hidden="true">#</a> 调试概念</h2><p>代码在不同平台运行时，将运行时状态通过某种方式暴露出来，传递给开发工具做UI展示和交互，辅助开发者排查问题、梳理流程、了解代码运行状态等，这个就是调试。</p><p>不同平台：浏览器、NodeJs、Electron、小程序、移动端等任何能执行JS代码的平台 暴露的运行时状态：调用栈、执行上下文、DOM结构等</p><h3 id="chrome-devtools原理"><a class="header-anchor" href="#chrome-devtools原理" aria-hidden="true">#</a> Chrome DevTools原理</h3><p>Chrome DevTools分为两部分:</p><ol><li>backend: backend与Chrome集成，负责把Chrome的网页运行时状态通过调试协议暴露出来</li><li>frontend: 负责对接调试协议，做UI的展示和交互</li></ol><p>两者之间的调试协议叫做Chrome DevTools Protocol，简称CDP</p><h2 id="调试js代码"><a class="header-anchor" href="#调试js代码" aria-hidden="true">#</a> 调试js代码</h2><ul><li><p>Chrome DevTools调试</p><p>创建调试项目，打开Chrome DevTools，在Sources面板中通过<code>ctrl+p</code>搜索js文件，打断点 <img src="/blog/_assets/chrome-debugger.7b848dd0.jpg" alt="chrome-debugger.jpg"></p></li><li><p>VSCode Debugger调试</p><p>比通过Chrome DevTools调试更好用</p><ol><li>打开项目目录，创建.vscode/launch.json文件</li><li>点击右下角Add Configuration...，选择Chrome: Launch</li><li>将访问的url改为开发服务器启动的地址，如react的项目为<code>http://localhost:3000</code></li><li>进入Debug窗口，点击启动 <img src="/blog/_assets/vscode-debugger1.c803ff03.jpg" alt="vscode-debugger1.jpg"></li><li>在代码处打断点，然后点击刷新按钮，调用上下文、堆栈信息都会展示在左 <img src="/blog/_assets/vscode-debugger2.9589894f.jpg" alt="vscode-debugger2.jpg"></li></ol></li><li><p>使用VSCode Debugger调试的好处</p><ol><li>不用切换工具，边调试边写代码</li><li>边调试边写代码，直接知道属性值是什么，有哪些函数可以调用，所以ts会有属性名提示，但并不知道属性值是什么</li></ol></li><li><p>为什么Chrome DevTools和VSCode debugger都可以调试网页</p><p>调试协议相同，都是CDP，通过对接CDP调试网页，只不过VSCode debugger多一层Debug Adapter Protocol转换</p></li></ul><h3 id="vscode-debugger配置详解"><a class="header-anchor" href="#vscode-debugger配置详解" aria-hidden="true">#</a> VSCode Debugger配置详解</h3><p>launch.json文件可以不用自己创建，可以直接点击Debug窗口的<code>create a launch.json file</code>快速创建<br></p><ul><li><p>launch/attach</p><p>我们知道调试就是把浏览器跑起来，并访问目标网页，这时候会有一个ws的调试服务，通过frontend的ws客户端连接上这个服务，就可以进行调试了。<br></p><p>launch就是把url对应的网页跑起来，指定调试端口，然后frontend会自动attach到这个端口上，而如果已经有了调试模式跑的浏览器了，只需要通过attach直接连接<br></p></li><li><p>为chrome配置调试模式</p><ol><li><p>添加remote-debugging-port=9222</p><p><img src="/blog/_assets/remote-debugging-port_9222.fbf3d872.jpg" alt="remote-debugging-port=9222.jpg"></p></li><li><p>关闭浏览器后重新打开，在地址栏输入chrome://version，命令行出现remote..就说明配置成功</p><p><img src="/blog/_assets/chrome-version.e0c58b5d.jpg" alt="chrome-version.jpg"></p></li><li><p>浏览器访问localhost:9222/json</p><p><img src="/blog/_assets/chrome-remote.cef3ee02.jpg" alt="chrome-remote.jpg"></p><p>每个页面是单独的ws服务，因为每个页面调试都是独立的</p></li><li><p>VSCode debugger添加一个attach的Chrome Debug配置，启动之后就可以看到所有的ws调试服务</p><p><img src="/blog/_assets/vscode-remote.47ca590a.jpg" alt="vscode-remote.jpg"></p></li></ol></li></ul><h2 id="sourcemap的原理和作用"><a class="header-anchor" href="#sourcemap的原理和作用" aria-hidden="true">#</a> sourcemap的原理和作用</h2><p>sourcemap是关联编译后的代码和源码的，通过一个个行列号的映射，比如编译后的代码的第3行第4列对应源码里的第8行第5列这种，叫做一个mapping <br></p><p>sourcemap格式如下：</p><div class="language-js"><pre><code><span class="token punctuation">{</span>\n  <span class="token literal-property property">version</span> <span class="token operator">:</span> <span class="token number">3</span><span class="token punctuation">,</span>\n  <span class="token literal-property property">file</span><span class="token operator">:</span> <span class="token string">&quot;out.js&quot;</span><span class="token punctuation">,</span>\n  <span class="token literal-property property">sourceRoot</span> <span class="token operator">:</span> <span class="token string">&quot;&quot;</span><span class="token punctuation">,</span>\n  <span class="token literal-property property">sources</span><span class="token operator">:</span> <span class="token punctuation">[</span><span class="token string">&quot;foo.js&quot;</span><span class="token punctuation">,</span> <span class="token string">&quot;bar.js&quot;</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n  <span class="token literal-property property">names</span><span class="token operator">:</span> <span class="token punctuation">[</span><span class="token string">&quot;a&quot;</span><span class="token punctuation">,</span> <span class="token string">&quot;b&quot;</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n  <span class="token literal-property property">mappings</span><span class="token operator">:</span> <span class="token string">&quot;AAgBC,SAAQ,CAAEA;AAAEA&quot;</span><span class="token punctuation">,</span>\n  <span class="token literal-property property">sourcesContent</span><span class="token operator">:</span> <span class="token punctuation">[</span><span class="token string">&#39;const a = 1; console.log(a)&#39;</span><span class="token punctuation">,</span> <span class="token string">&#39;const b = 2; console.log(b)&#39;</span><span class="token punctuation">]</span>\n<span class="token punctuation">}</span>\n</code></pre></div><ul><li>file：文件名</li><li>sourceRoot：源码根目录</li><li>names：转换前的变量名</li><li>sources：源码文件，可能有多个，因为编译产物是通过多个源文件合成的，比如webpack打包会将多个js文件打包成一个文件</li><li>sourcesContent：是每个sources对应的源码内容</li><li>mappings：一个个位置映射，通过分号<code>;</code>和逗号<code>,</code>分割，<code>;</code>代表一行，这样就免去行的映射，<code>,</code>代表行里面的位置映射</li></ul><p>各种调试工具一般都支持sourcemap的解析，只需要在文件末尾加上一行<code>//@ sourceMappingURL=/path/to/source.js.map</code>，调试时就会自动关联到sourcemap <img src="/blog/_assets/sourcemap-url.3d70fec4.jpg" alt="sourcemap-url.jpg"></p><p>开发时使用sourcemap来调试，生产时不会，但需要报错时定位到源码位置，一般通过<a href="http://wangxiang.website/docs/work/sentry.html" target="_blank" rel="noopener noreferrer">错误管理平台进行收集</a></p><p>sourcemap只是位置的映射，可以用在任何代码上，比如TS、JS、CSS等，而且TS类型也支持sourcemap，只需要配置tsconfig.json <img src="/blog/_assets/tsconfig-json.fff0558d.jpg" alt="tsconfig-json.jpg"> 指定declaration 会生成 d.ts 的声明文件，还可以指定 declarationMap 来生成 sourcemap，这样在VScode中可以直接点击某个类型来跳转到源码对应的地方 <img src="data:image/jpeg;base64," alt="index-d-ts.jpg"></p><h3 id="sourcemap的生成"><a class="header-anchor" href="#sourcemap的生成" aria-hidden="true">#</a> sourcemap的生成</h3><p>略过</p><h2 id="webpack的sourcemap配置"><a class="header-anchor" href="#webpack的sourcemap配置" aria-hidden="true">#</a> webpack的sourcemap配置</h2><p>配置规律：其实是集中基础配置的组合，将eval、nosources、cheap、module等按照规律组合起来，就是一个配置</p><p>正则<code>^(inline-|hidden-|eval-)?(nosources-)?(cheap-(module-)?)?source-map$</code></p><h3 id="eval"><a class="header-anchor" href="#eval" aria-hidden="true">#</a> eval</h3><p>在js中，eval主要用来动态执行js代码，如下</p><div class="language-js"><pre><code><span class="token function">eval</span><span class="token punctuation">(</span><span class="token template-string"><span class="token template-punctuation string">`</span><span class="token string">\n  function add(a, b) {\n    return a + b;\n  }\n  add(1,2)\n  //# sourceURL=wangxiang.js\n  //# sourceMappingURL=wangxiang.js.map\n</span><span class="token template-punctuation string">`</span></span><span class="token punctuation">)</span>\n</code></pre></div><p>通过在尾部添加<code>//# sourceURL=xxx.js</code>，可以将代码添加到sources中，并且可以通过<code>/# sourceMappingURL=xxx</code>指定 sourcemap 来映射到源码</p><p>webpack就是利用eval这个特性来优化sourcemap生成的性能，主要是快，不用生成mapping</p><h3 id="source-map"><a class="header-anchor" href="#source-map" aria-hidden="true">#</a> source-map</h3><p>此配置用来生成独立的sourcemap文件，可以关联也可以不关联，比如加上hidden就是不关联，如生产环境不需要关联sourcemap，但上传错误管理平台需要生成sourcemap文件，用hidden就可以</p><div class="language-json"><pre><code>...\ndevtool<span class="token operator">:</span> &#39;hidden-source-map&#39;\n...\n</code></pre></div><h3 id="cheap"><a class="header-anchor" href="#cheap" aria-hidden="true">#</a> cheap</h3><p>sourcemap慢主要是生成mapping比较慢，因为会映射到行和列，但一般只需要映射到行就行，这时候就可以用cheap</p><h3 id="module"><a class="header-anchor" href="#module" aria-hidden="true">#</a> module</h3><p>webpack会对一个模块进行多次处理，比如经过loader A做一次转换，经过loader B再做一次转换，之后打包在一起，每次转换都生成sourcemap，就是会生成多个sourcemap</p><h3 id="nosources"><a class="header-anchor" href="#nosources" aria-hidden="true">#</a> nosources</h3><p>sourcemap里有sourceContent部分，直接把源码贴在这里，这样的好处是根据文件路径找不到文件也可以映射，但这样会增加sourcemap的体积，如果确定根据文件路径能找到源文件的话，就不用生成sourceContent，文件也会小很多</p><h2 id="调试react代码"><a class="header-anchor" href="#调试react代码" aria-hidden="true">#</a> 调试React代码</h2><p>需要sourcemap，但通过npm下载的react、react-dom都不带sourcemap，所以需要下载React源码自己build生成sourcemap</p><ol><li><p>下载react源码</p><div class="language-bash"><pre><code><span class="token function">git</span> clone https://github.com/facebook/react\n</code></pre></div></li><li><p>改造build过程，添加sourcemap配置</p><p>在scripts/rollup/build.js中添加sourcemap配置</p><div class="language-js"><pre><code><span class="token operator">...</span>\n <span class="token keyword">return</span> <span class="token punctuation">{</span>\n   <span class="token literal-property property">file</span><span class="token operator">:</span> outputPath<span class="token punctuation">,</span>\n   format<span class="token punctuation">,</span>\n   globals<span class="token punctuation">,</span>\n   <span class="token literal-property property">freeze</span><span class="token operator">:</span> <span class="token operator">!</span>isProduction<span class="token punctuation">,</span>\n   <span class="token literal-property property">interop</span><span class="token operator">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span>\n   <span class="token literal-property property">name</span><span class="token operator">:</span> globalName<span class="token punctuation">,</span>\n   <span class="token literal-property property">sourcemap</span><span class="token operator">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span>\n   <span class="token literal-property property">esModule</span><span class="token operator">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span>\n   <span class="token literal-property property">sourcemap</span><span class="token operator">:</span> <span class="token boolean">true</span>\n <span class="token punctuation">}</span><span class="token punctuation">;</span>\n<span class="token operator">...</span>   \n</code></pre></div></li><li><p>执行npm run build</p><p>此时执行还是会报错：某个转换的插件没有生成sourcemap <img src="/blog/_assets/build-react-error.0a6b9f60.jpg" alt="build-react-error.jpg"></p><p>因为构建过程会进行多次转换，会生成多次sourcemap，然后把sourcemap串联起来就是最终的sourcemap，如果中间有一步转换没有生成sourcemap，断掉了就没法把sourcemap串联起来。</p><p>解决方法：将没有生成sourcemap的几个插件注释掉</p></li><li><p>注释插件</p><p>build中找到getPlugins方法，将5个插件注释</p></li><li><p>再次执行npm run build ，即可打包出带有sourcemap的react包</p><p>直接将打包后的react和react-dom包丢到node_modules下，是不能直接调试react源码的，因为webpack打包并没有关联react相关包的sourcemap，只能映射到react-dom.development.js而不能进一步映射到源码</p><p>解决方法：</p><ol><li>添加sourcemap配置，xxx-module-source-map加上module可以读取和关联loader的sourcemap，从而关联到源码，但webpack配置麻烦</li><li>不打包react和react-dom包，用script标签引入，浏览器会解析各自的sourcemap，进而映射到源码</li></ol></li><li><p>create-react-app脚手架创建的项目要么执行npm run eject弹窗webpack配置去修改externals，要么使用custom-cra修改配置</p><div class="language-js"><pre><code><span class="token comment">// config-overrides.js</span>\n<span class="token keyword">const</span> <span class="token punctuation">{</span>\n   override<span class="token punctuation">,</span>\n   overrideDevServer<span class="token punctuation">,</span>\n   addWebpackAlias<span class="token punctuation">,</span>\n   addLessLoader<span class="token punctuation">,</span>\n   addWebpackExternals<span class="token punctuation">,</span>\n   fixBabelImports<span class="token punctuation">,</span>\n <span class="token punctuation">}</span> <span class="token operator">=</span> <span class="token function">require</span><span class="token punctuation">(</span><span class="token string">&quot;customize-cra&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n   <span class="token literal-property property">webpack</span><span class="token operator">:</span> <span class="token function">override</span><span class="token punctuation">(</span>\n     <span class="token comment">// 不做打包处理cdn直接引用</span>\n     <span class="token function">addWebpackExternals</span><span class="token punctuation">(</span><span class="token punctuation">{</span>\n       <span class="token literal-property property">react</span><span class="token operator">:</span> <span class="token string">&#39;React&#39;</span><span class="token punctuation">,</span>\n       <span class="token string-property property">&#39;react-dom&#39;</span><span class="token operator">:</span> <span class="token string">&#39;ReactDOM&#39;</span>\n     <span class="token punctuation">}</span><span class="token punctuation">)</span>\n     <span class="token operator">...</span>\n   <span class="token punctuation">)</span><span class="token punctuation">}</span>\n</code></pre></div></li><li><p>将react.development.js和react-dom.development.js和对应的sourcemap文件放在public下，在index.html中引入</p><div class="language-html"><pre><code>...\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">&quot;</span>./react.development.js<span class="token punctuation">&quot;</span></span><span class="token punctuation">&gt;</span></span><span class="token script"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">&quot;</span>./react-dom.development.js<span class="token punctuation">&quot;</span></span><span class="token punctuation">&gt;</span></span><span class="token script"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">&gt;</span></span>\n...\n\n</code></pre></div></li><li><p>这时候再次点击调试，可以看到调用栈直接定位到了本地的react项目下，此时就是直接调试react源码</p><p>.<img src="/blog/_assets/react-resource.b8a1f05a.jpg" alt="react-resource.jpg"></p></li><li><p>此时因为本地clone下来的react项目和当前调试项目不在一个workspace下，VSCode不会直接定位到react源码项目，将react项目添加到同一个workspace中即可</p></li></ol>',46)];p.render=function(e,n,p,t,c,r){return a(),s("div",null,o)};export{n as __pageData,p as default};
